import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

export const ListJustifyOrder = {
  start: "flex-start",
  end: "flex-end",
  center: "center",
  between: "space-between",
};

export const ListAlignOrder = {
  start: "flex-start",
  end: "flex-end",
  center: "center",
  between: "space-between",
};

export const ListDirection = {
  row: "row",
  col: "column",
};

const List = ({
  children,
  style = {
    card: false,
    width: "100%",
    justify: ListJustifyOrder.start,
    align: ListAlignOrder.start,
    direction: ListDirection.row,
  },
}) => {
  return <Styled.List style={style}>{children}</Styled.List>;
};

List.propTypes = {
  children: propTypes.node.isRequired,
  style: propTypes.shape({
    card: propTypes.bool,
    width: propTypes.string,
    justify: propTypes.string,
    align: propTypes.string,
  }),
};

export default List;
